import React from "react";
import { useNavigate } from "react-router-dom";

const SearchInput = ({ search, setSearch, handleSearch }) => {
  const navigate = useNavigate();

  const handleSubmit = () => {
    handleSearch();
    navigate('/SearchResults');
  };

  return (
    <section className="imputContainer">
      <article className="titleContainer">
        <h1 className="titleSearch">Busqueda por Artista</h1>
      </article>
      <article className="inputSearch">
        <input
          placeholder="Busqueda de Artista"
          className="labelInput"
          type="text"
          value={search}
          onChange={(e) => setSearch(e.target.value)}
          onKeyDown={(e) => {
            if (e.key === 'Enter') {
              e.preventDefault();
              handleSubmit();
            }
          }}
        />
        <button className="buttonInput" onClick={handleSubmit}>
          Buscar
        </button>
      </article>
    </section>
  );
};

export default SearchInput;
